import type { IsAny, OmitIndexSignature } from "../internal";

export type ActionHandler<A extends Action = Action, Return = void>
    = A extends unknown
        ? unknown extends (
            IsAny<A[Extract<string, keyof A>]>
            & IsAny<A[Extract<number, keyof A>]>
            & IsAny<A[Extract<symbol, keyof A>]>
        )
            ? (action: any) => Return
            : (action: A) => Return
        : never;

export type Action
    // Workaround to avoid ts(2589)
    = { type: Exclude<ActionType, keyof ValidActionOverrides>; } & Record<PropertyKey, any>
    // eslint-disable-next-line @typescript-eslint/no-redundant-type-constituents
    | ValidActionOverrides[keyof ValidActionOverrides];

type ValidActionOverrides = {
    // eslint-disable-next-line @typescript-eslint/no-redundant-type-constituents
    [Key in keyof OmitIndexSignature<ActionOverride> & string as ActionOverride[Key]["type"] extends Key
        ? Key extends ActionOverride[Key]["type"]
            ? Key
            : never
        : never
    ]: ActionOverride[Key];
};

/**
 * Augment this interface to override actions of {@link Action} and add action types to {@link ActionType}.
 * Actions whose type does not match their key will be omitted.
 * @see https://typescriptlang.org/docs/handbook/declaration-merging#module-augmentation
 */
export interface ActionOverride extends Record<string, { type: string; }> {}

export type ExcludeAction<A extends Action, T extends A["type"]>
    = A extends unknown
        // Workaround to avoid ts(2589)
        ? Exclude<A["type"], T> extends never
            ? never
            : A & { type: Exclude<A["type"], T>; }
        : never;

export type ExtractAction<A extends Action, T extends A["type"]>
    = A extends unknown
        // Workaround to avoid ts(2589)
        ? A["type"] & T extends never
            ? never
            : A & { type: T; }
        : never;

