export type ActionType = DefaultActionType
    // eslint-disable-next-line @typescript-eslint/no-duplicate-type-constituents, @typescript-eslint/no-redundant-type-constituents
    | keyof ValidActionTypeOverrides | keyof ValidActionOverrides;

type ValidActionTypeOverrides = {
    // eslint-disable-next-line @typescript-eslint/no-redundant-type-constituents
    [Key in keyof OmitIndexSignature<ActionTypeOverride> & string as ActionTypeOverride[Key] extends never
        ? Key
        : never
    ]: ActionOverride[Key];
};

/**
 * Augment this interface to add action types to {@link ActionType}.
 * Properties whose type is not never will be omitted.
 * @see https://typescriptlang.org/docs/handbook/declaration-merging#module-augmentation
 */
export interface ActionTypeOverride extends Record<string, never> {}

